const mongoose = require('mongoose');

const productSchema = new mongoose.Schema({
    productName: {
        type: String,
        required: true,
        unique: true
    },
    productDescription: {
        type: String,
        required: true
    },
    productPrice: {
        type: Number,
        required: true
    },
    productImage: {
        type: String,
        required: true
    }
},
    {
        timestamps: true
    });

const categorySchema = new mongoose.Schema({
    categoryName: {
        type: String,
        required: true,
        unique: true
    },
    categoryDescription: {
        type: String,
        required: true
    },
    categoryImage: {
        type: String,
        required: true,
        unique: true
    },
    products: {
        type: [productSchema],
        default: []
    }
},
    {
        timestamps: true
    });

const Category = mongoose.model('Category', categorySchema, 'categories');

async function addCategory(categoryName, categoryDescription, categoryImage) {
    try {
        categoryName = categoryName.replace(/[a-zA-Z]/g, c => c.toLowerCase());
        const category = new Category({
            categoryName,
            categoryDescription,
            categoryImage
        });
        await category.save();
        return category;
    } catch (error) {
        log.error(error);
        return null;
    }
}

