function combineData(data) {
    const [names, cities, grades] = data;
    return names.map(user => ({...user, ...cities.find(city => city.id === user.id)}))
    .map(user => ({...user, ...grades.find(grade => grade.id === user.id)}));
}   

async function action(promises) {
    const data = await Promise.all(promises);
    const readyData = combineData(data);
    await write('data/student-data.json', JSON.stringify(readyData, null, 2));
}


